import React, { useState } from 'react';

const Register = () => {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password_digest, setPassword_digest] = useState('');

  const handleUsernameChange = (e) => {
    setUsername(e.target.value);
  };

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handlePassword_digestChange = (e) => {
    setPassword_digest(e.target.value);
  };

  const handleRegister = (e) => {
    e.preventDefault();

    // Prepare the registration data
    const registrationData = {
      username,
      email,
      password_digest,
    };

    // Send the registration request to the API
    fetch('/register', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(registrationData),
    })
      .then((response) => {
        if (response) {
          // Registration successful
          console.log('Registration successful');
          // Reset the form
          setUsername('');
          setEmail('');
          setPassword_digest('');
        } else {
          // Registration failed
          console.log('Registration failed');
          // Handle the registration failure, show error message, etc.
        }
      })
      .catch((error) => {
        console.log('Registration error:', error);
        // Handle any errors that occurred during registration
      });
  };

  return (
    <div className="register-container">
    <div className="register-content">

    <div className="login-box">
      <p>Register</p>
      <form onSubmit={handleRegister}>
        <div className="user-box">
          <input type="text" value={username} onChange={handleUsernameChange} required />
          <label>Name:</label>
        </div>
        <div className="user-box">
          <input type="email" value={email} onChange={handleEmailChange} required />
          <label>Email:</label>
        </div>
        <div className="user-box">
          <input type="password_digest" value={password_digest} onChange={handlePassword_digestChange} required />
          <label>Password:</label>
        </div>
        <a href="#">
      <span></span>
      <span></span>
      <span></span>
      <span></span>
      Register
    </a>
      </form>
    </div>
    </div>
    </div>
  );
};

export default Register;
